# Get ratio of connected nodes to all known nodes. Get range: (0, 1)
# Shift range to be (-0.001, 0.999)
# Divide it by 0.998 to make range upper bound at least 1.
# "floor" value to convert it to discrete one {-1, 0, 1}
min by (tenant)(
  clamp_max(
    floor(
      (sum by (tenant, instance)(ixnnode_redis_client_status) /
        count by (tenant, instance)(ixnnode_redis_client_status) - 0.001) / 0.998
    ), 1
  )
)
OR min by (tenant)(((up{servicename="ixn", container="ixn-node"} > 0) > bool 1) - 1)

